					<div className="header-top">

						<div className="header-top-left">Доставка пиццы<br/>бесплатно</div>

						<div className="header-top-center">Пицца<br/>Феникс</div>

						<div className="header-top-right">
							<div className="header-contacts">377-60-20</div>
							<div className="header-deliverytime">доставка пиццы<br/>круглосуточно</div>
						</div>

					</div>

					<div className="header-bottom"></div>

				</div>

			</header>

		</div>
	)
}

export default App;
